import styled from "styled-components";

export const BlockButton = styled.button`
  padding: 3% 5%;
  margin: 54px 0 0 0;

  font-size: 10px;
  background: #fff;
  border: 1px solid #000000;

  @media (min-width: 1024px) {
    font-size: 14px;
    cursor: pointer;
    border: 2px solid #000000;
  }
`;
